class Button extends Component {
    state = {
        button: {
            closeText: '收合',
            openText: '展開',
            class: 'btn',
        },
    }
    render() {
        // const { className } = this.props;
        return (
            <div className={this.state.button.class}>

            </div>
        )
    }
}
export default Button;
